function App() {
  return (
    <>
       <BrowserRouter>
       <Routes>
      <Route exact path="/" element={<Home />}/>

        <NavBar />
        <SearchBar />
        <JobListing />
        <JobDetail/>
        </Routes>
        </BrowserRouter>
    </>

  );
}

export default App;
